import React from 'react';
import GetUsers from '../components/';
import { UsersContextProvider } from '../context/UsersContext';

const AdminPage = () => {
  return (
    <UsersContextProvider>
      <div>
        <h1>Admin Page</h1>
        <GetUsers />
      </div>
    </UsersContextProvider>
  );
}

export default AdminPage;
